import './App.css';
import Login from './Pages/Login/Login';
import Intro from './Pages/Home/Intro';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/c"element={<Intro />}/>
      <Route path="/login" element={<Login />} />

    </Routes>
    </BrowserRouter>
    </>

  );
}

export default App;
